import React, { Component } from 'react';
import { connect } from 'react-redux';

class EnginePick extends Component {

  state = {
    mainUnitAssemblies: []
  }

  componentDidMount() {
    console.log("mounted")
    fetch(`http://localhost:3000/models/${this.props.modelId}/assemblies`)
    .then(resp => resp.json())
    .then(json => {
      const mainUnitAssemblies = json.filter( assembly => assembly.assembly_type === "main_unit")

      this.setState({
        mainUnitAssemblies: mainUnitAssemblies
      })
    })
  
  }

  render() {
    return (
      <div className="w-1/2 mx-auto h-1/2 place-self-center">
        Pick Engine
      </div>
    );
  }
}

const mapStateToProps = state => (
  {modelId: state.modelId}
)

const mapDispatchToProps = dispatch => (
  {}
)



export default connect(mapStateToProps, mapDispatchToProps)(EnginePick)
